import React from 'react';
import './style.css';

const imagens = [
  { url: 'data:image/jpeg;base64,', legenda: 'Specialized Tarmac' },
  { url: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTeaOCh7ttYeUX371U4JODC3prvilu2uKuvUg&s', legenda: 'Canyon Grail CF SL 8' },
  { url: 'data:image/jpeg;base64,', legenda: 'Van Rysel RCR SRAM Rival AXS' },
];

const GaleriaImagens = () => {
  return (
    <div className="galeria">

      {imagens.map((imagem, index) => (
        <div key={index} className="item">
          <img src={imagem.url} alt={`Imagem ${index + 1}`} />
          <p className="legenda">{imagem.legenda}</p>
        </div>
      ))}

    </div>
  );
};

export default GaleriaImagens;
